import React from 'react'
import image from '../images/card.png'
import LogInPage from '../components/LogInPage'

const Login = () => {
  return (
    <div className="Login">
      <span><img className="LoginImage" src={image} alt="card" /> </span>
      <span><LogInPage /></span>
    </div>
  )
}

export default Login
